import React from 'react';
import { Link } from 'react-router-dom';
import './styles/products.css'; // Ensure this path matches your directory structure

const menuItems = [
  { imgSrc: '/img/images (6).jpeg', title: 'Chocolate Cake', price: 35, rating: 5 },
  { imgSrc: '/img/download - Copy.jpeg', title: 'Vanilla Cake', price: 15 },
  { imgSrc: '/img/download (4).jpeg', title: 'Strawberry Cake', price: 20 },
  { imgSrc: '/img/download (3).jpeg', title: 'Lemon Cake', price: 20 },
  { imgSrc: '/img/download (7).jpeg', title: 'White Chocolate Cake', price: 20 },
  { imgSrc: '/img/download (5).jpeg', title: 'Red Velvet Cake', price: 30 },
  { imgSrc: '/img/images (2) - Copy.jpeg', title: 'Matcha Cake', price: 20 },
  { imgSrc: '/img/images (3) - Copy.jpeg', title: 'Caramel Cake', price: 20 },
  { imgSrc: '/img/images (1) - Copy.jpeg', title: 'Chocolate Vanilla Mixed Cake', price: 25 },
  { imgSrc: '/img/pista.jpeg', title: 'Pistachio Cake', price: 15 },
  { imgSrc: '/img/banana.jpeg', title: 'Banana Cake', price: 20 },
  { imgSrc: '/img/black.jpeg', title: 'Black Forest Cake', price: 35 }
];

const Products = () => {
  return (
    <div>
      <header className="header">
        <div className="logo">
          <img src="/img/Sweet Cake.png" width="150px" style={{ cursor: 'pointer' }} alt="Sweet Cake" />
        </div>
        <nav className="nav">
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/components/about">About Us</Link></li>
            <li><Link to="/components/products">Products</Link></li>
            <li><Link to="/components/contact">Contact Us</Link></li>
            <li><Link to="/components/info">Info</Link></li>
          </ul>
        </nav>
      </header>
      <div className="menu-container">
        {menuItems.map((item, index) => (
          <div className="menu-card" key={index}>
            <img src={item.imgSrc} alt={item.title} />
            <h2>{item.title}</h2>
            <p className="price">${item.price}</p>
            {item.rating && <p className="rating">{item.rating} Stars</p>}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Products;
